import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
  console.log('hello {n}',34)
  const now = new Date()
  const a = 10
  const b = 20
  return (
    <div>
      <p>Hellllllo world it is {now.toISOString}</p>
      <p>
        {a} plus {b} is {a+b}
      </p>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
